import React, { useEffect } from 'react'
import Blog1 from '../../assets/images/blog1.jpeg'
import Tag from '../../assets/images/label.png'
import Time from '../../assets/images/clock.png'
import { Swiper, SwiperSlide } from 'swiper/react';
import { Navigation } from 'swiper/modules';
import { Mousewheel, Pagination } from 'swiper/modules';

// Import Swiper styles
import 'swiper/css';
import 'swiper/css/pagination';
import 'swiper/swiper.min.css';
import 'swiper/components/navigation/navigation.min.css';
import 'swiper/components/pagination/pagination.min.css';


export default function Blog() {
  const [swiper, setSwiper] = useState(null);

  const handleMousewheelComplete = () => {
    // Check if the slider has reached the end
    if (swiper.isEnd) {
      // Scroll down or perform any desired action here
      window.scrollTo(0, window.innerHeight);
    }
  };


  return (
    <div>
      <section class="blog__area no-pb blog__animation">
        <div class="container g-0 line pt-30 pb-100">
          <span class="line-3"></span>
          <div class="row">
            <div class="col-xxl-12 col-xl-12 col-lg-12 col-md-12">
              <div class="sec-title-wrapper">
                {/* <h2 class="sec-sub-title">recent blog</h2> */}
                <h3 class="sec-title">Blog</h3>
              </div>
            </div>
          </div>

          <Swiper
            // loop={true}
      mousewheel={true}
      navigation={true}
      slidesPerView={1}
      spaceBetween={10}
      pagination={{ clickable: true }}
      breakpoints={{
        '@0.00': {
          slidesPerView: 1,
          spaceBetween: 10,
        },
        '@0.75': {
          slidesPerView: 2,
          spaceBetween: 20,
        },
        '@1.00': {
          slidesPerView: 2,
          spaceBetween: 40,
        },
        '@1.50': {
          slidesPerView: 3,
          spaceBetween: 50,
        },
      }}
      modules={[Mousewheel, Navigation, Pagination]}
      className="mySwiper"
      onSwiper={setSwiper}
      onReachEnd={handleMousewheelComplete}>
            <SwiperSlide>
              <article class="blog__item" style={{
